import Navbar from './components/Navbar';
import VideoFeed from './components/VideoFeed';

function App() {
  return (
    <Router>
      <Navbar />
      <Routes>
        <Route path="/" element={<VideoFeed />} />
        <Route path="/profile" element={<Profile />} />
        {/* Tambahkan ini jika kamu ingin upload */}
        <Route path="/upload" element={<h2>Halaman Upload (belum dibuat)</h2>} />
      </Routes>
      <VideoFeed />
    </Router>
  );
}

export default App;
